import { useEffect, useState} from 'react';

import {
    Table,
    TableBody,
    TableCell,
    TableHead,
    TableRow,
  } from '@mui/material';

export const InventoryTable = () => {
    const [inventory, setInventory]= useState([]);


    // useEffect(()=> {
    //     sneakerService.getAllSneakers()
    //     .then(res => {
    //         setSneakers(res.data);
    //     })
    // }, [])



    return (
        <div >
            <Table sx={{minWidth:700}}>
                <TableHead sx={{}}>
                <TableRow>
                    <TableCell>
                        Id
                    </TableCell>                        
                    <TableCell>
                       Date
                    </TableCell>
                    <TableCell>
                        Name
                    </TableCell>
                    <TableCell>
                       Category
                    </TableCell>
                </TableRow>
                </TableHead>
                <TableBody>
                    {
                        inventory.map((table)=> {
                            return(
                                <TableRow
                                    hover
                                    key={table.id}
                                >
                                    <TableCell>
                                        {table.id}
                                    </TableCell>
                                    <TableCell>
                                        {table.date}
                                    </TableCell>
                                    <TableCell>
                                        {table.name}
                                    </TableCell>
                                    <TableCell>
                                        {table.category}
                                    </TableCell>
                                </TableRow>
                            ) 
                        })
                    }
                </TableBody>
            </Table>
        </div>
    )
}
